(function(){
var json = [{
 'ranges':[
  {'min':0,'max':10,'itemPackRangeID':null},
  {'min':23,'max':45,'itemPackRangeID':null}
 ]
}];

var output = '';
var data = json[0];
var relevant = data.ranges;
for (var i = 0; i < relevent.length; i++) {
 var range = relevent[i];
 output += range.min + '-' + range.max + '\n';
}

return output;


})()

